def merge_two_sorted_arrays(array_a, array_b):
    merged = []
    i = 0
    j = 0
    while True:
        if i < len(array_a):
            if j < len(array_b):
                if array_a[i] >= array_b[j]:
                    merged.append(array_b[j])
                    j += 1
                else:
                    merged.append(array_a[i])
                    i += 1
            else:
                merged.extend(array_a[i:len(array_a)])
                break
        else:
            merged.extend(array_b[j:len(array_b)])
            break

    return merged


